function Company() {
  const [company, setCompany] = useState();

  const { companyId } = useParams();

  useEffect(() => {
    const api = axios.create({
      baseURL: "http://127.0.0.1:8000",
    });
    api
      .get("/companies/")
      .then((response) => {
        setCompany(response.data);
        console.log(response.data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);
